INSERT INTO `con_template` VALUES ('01', 'BPM合约0.1', 'pragma solidity ^0.5.0;\r\n\r\ncontract bpmData {\r\n    \r\n    constructor() public {\r\n    }\r\n    //合约名称\r\n    string name=\"BPM数据合约v0.1\";\r\n\r\n    //记录数据总条目指针\r\n    uint position=0;\r\n    //记录实际数据数量\r\n    uint number=0;\r\n\r\n    //记录每一个编号的key值的数组\r\n    mapping (uint => string) keys;\r\n  \r\n    //记录每一条key的value值\r\n    mapping (string => string) dataMap;\r\n\r\n    //增加一条数据（为了快速，先不判断是否已存在，认为后端不会调错函数）\r\n    function insert(string memory _key,string memory _value) public { \r\n      keys[position]=_key;\r\n      position++;\r\n      number++;\r\n      dataMap[_key] = _value;\r\n    }\r\n    //修改一条数据\r\n    function update(string memory _key,string memory _value) public { \r\n      dataMap[_key] = _value;\r\n    }\r\n    //删除一条数据\r\n    function remove(string memory _key,string memory _value) public { \r\n      dataMap[_key] = _value;\r\n      number--;\r\n    }\r\n    //读取一条数据\r\n    function get(string memory _key) public view returns (string memory) { \r\n      return dataMap[_key];\r\n    }\r\n\r\n    //获得有效实际数据总条数\r\n    function getLength() public view returns (uint) { \r\n      return number;\r\n    }\r\n    //获得当前数据位置\r\n    function getPosition() public view returns (uint) { \r\n      return position;\r\n    }\r\n\r\n    //获得合约名称\r\n    function getName() public view returns (string memory) { \r\n      return name;\r\n    }\r\n    //设置合约名称\r\n    function setName(string memory _name) public { \r\n      name =  _name;\r\n    }\r\n}', 'ca4d5f11fdf34193a9e664722c3698b7', '0', '1', '2020-11-28 15:13:52', '1', '2020-12-02 09:45:17', '', '001001001', '', '0xc17315157b7a5c29a53b9c5c21a0fa82fcd40ccc28aba9f0eda795e80520ad4f');
