INSERT INTO `prt_information` VALUES ('4f6ce948b2a144d899e527a1a6936f8b', 'ac06a0c5be554522bcbb239d5d4c8dbf', '再创世界纪录！中老昆万铁路世界第一高桥合龙(图)', '', '新浪', '', '世界跨度最大的上承式连续钢桁梁铁路桥，中老昆（明）万（象）铁路元江双线特大桥合龙！相当于54层楼高的桥墩，249米的主跨，双双位居同类桥梁世界第一！铁路全线明年底将建成通车，云南昆明至老挝万象有望实现夕发朝至！期待！', '20', '1', '<p style=\"margin-bottom: 18px; color: rgb(77, 79, 83); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;\\\\5FAE软雅黑&quot;, SimSun, &quot;\\\\5B8B体&quot;, Arial; font-size: 18px; letter-spacing: 1px;\">原标题：再创世界纪录！#中老昆万铁路世界第一高桥合龙#[威武]</p><p style=\"margin-bottom: 18px; color: rgb(77, 79, 83); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;\\\\5FAE软雅黑&quot;, SimSun, &quot;\\\\5B8B体&quot;, Arial; font-size: 18px; letter-spacing: 1px;\">　　昨天，世界跨度最大的上承式连续钢桁梁铁路桥，中老昆（明）万（象）铁路元江双线特大桥合龙！相当于54层楼高的桥墩，249米的主跨，双双位居同类桥梁世界第一！铁路全线明年底将建成通车，云南昆明至老挝万象有望实现夕发朝至！期待！（总台央视记者刘文杰 李劲松）</p><div class=\"img_wrapper\" style=\"text-align: center; color: rgb(77, 79, 83); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;\\\\5FAE软雅黑&quot;, SimSun, &quot;\\\\5B8B体&quot;, Arial; font-size: 18px; letter-spacing: 1px;\"><img src=\"https://n.sinaimg.cn/front20200702ac/706/w900h606/20200702/d067-ivwfwmn5157085.jpg\" alt=\"\" style=\"margin: 0px auto; padding: 0px; border-style: none; vertical-align: top; display: block; max-width: 640px;\"><span class=\"img_descr\" style=\"margin: 5px auto; padding: 6px 0px; line-height: 20px; font-size: 16px; display: inline-block; zoom: 1; text-align: left; font-weight: 700;\"></span></div><div class=\"img_wrapper\" style=\"text-align: center; color: rgb(77, 79, 83); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;\\\\5FAE软雅黑&quot;, SimSun, &quot;\\\\5B8B体&quot;, Arial; font-size: 18px; letter-spacing: 1px;\"><img src=\"https://n.sinaimg.cn/front20200702ac/698/w599h899/20200702/176a-ivwfwmn5157163.jpg\" alt=\"\" style=\"margin: 0px auto; padding: 0px; border-style: none; vertical-align: top; display: block; max-width: 640px;\"><span class=\"img_descr\" style=\"margin: 5px auto; padding: 6px 0px; line-height: 20px; font-size: 16px; display: inline-block; zoom: 1; text-align: left; font-weight: 700;\"></span></div><div class=\"img_wrapper\" style=\"text-align: center; color: rgb(77, 79, 83); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;\\\\5FAE软雅黑&quot;, SimSun, &quot;\\\\5B8B体&quot;, Arial; font-size: 18px; letter-spacing: 1px;\"><img src=\"https://n.sinaimg.cn/front20200702ac/698/w899h599/20200702/7643-ivwfwmn5157352.jpg\" alt=\"\" style=\"margin: 0px auto; padding: 0px; border-style: none; vertical-align: top; display: block; max-width: 640px;\"><span class=\"img_descr\" style=\"margin: 5px auto; padding: 6px 0px; line-height: 20px; font-size: 16px; display: inline-block; zoom: 1; text-align: left; font-weight: 700;\"></span></div><div class=\"img_wrapper\" style=\"text-align: center; color: rgb(77, 79, 83); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;\\\\5FAE软雅黑&quot;, SimSun, &quot;\\\\5B8B体&quot;, Arial; font-size: 18px; letter-spacing: 1px;\"><img src=\"https://n.sinaimg.cn/front20200702ac/690/w899h591/20200702/1059-ivwfwmn5157405.jpg\" alt=\"\" style=\"margin: 0px auto; padding: 0px; border-style: none; vertical-align: top; display: block; max-width: 640px;\"><span class=\"img_descr\" style=\"margin: 5px auto; padding: 6px 0px; line-height: 20px; font-size: 16px; display: inline-block; zoom: 1; text-align: left; font-weight: 700;\"></span></div><div class=\"img_wrapper\" style=\"text-align: center; color: rgb(77, 79, 83); font-family: &quot;Hiragino Sans GB&quot;, &quot;Microsoft Yahei&quot;, &quot;\\\\5FAE软雅黑&quot;, SimSun, &quot;\\\\5B8B体&quot;, Arial; font-size: 18px; letter-spacing: 1px;\"><img src=\"https://n.sinaimg.cn/front20200702ac/724/w900h624/20200702/71f3-ivwfwmn5157453.jpg\" alt=\"\" style=\"margin: 0px auto; padding: 0px; border-style: none; vertical-align: 